import React from 'react';
import { ChakraProvider } from "@chakra-ui/react";
import Speed from './components/Speed'
import Operation from './components/Operation';

function App() {
  return (
  <ChakraProvider>
  <div className="App">
    <Speed/>
    <Operation/>
  </div>
  </ChakraProvider>
  );
}

export default App;
